webpackJsonp([18588344968191],{563:function(e,t){e.exports={data:{markdownRemark:{html:'<p>After introducing Ethan to Pokémon a couple of months ago, this morning we finished rewatching the 82 episode strong first season. It’s surprising how well a children’s TV show from 1997 still holds up today. A lot of it will be nostalgia for me; but Ethan is watching it as a child for the first time over 20 years after its debut - and he loves it.</p>\n<p><img src="/images/pokemon-ethan-book.jpg" alt="Ethan with my old Pokémon book"></p>\n<p>Over the last couple of months he has become obsessed with Pokémon; our house is slowly filling with toys, books, cards, clothes, and a mass of other Pokémon merchandise. It’s really surprising how quickly he’s learnt the names of all the Pokémon, much quicker than learning the far fewer letters of the alphabet a few years previous.</p>\n<p>Its going to be great fun when he’s old enough to play the games; lets see if he can beat me in battle on Pokémon Red and Blue. But for now we’ll stick with the TV show; next up is the emotional rollercoaster of <a href="https://www.imdb.com/title/tt0190641/">Pokémon: The First Movie - Mewtwo Strikes Back</a>.</p>\n<p><img src="/images/pokemon-movie-still.jpg" alt="Pokémon: The First Movie - Mewtwo Strikes Back"></p>',timeToRead:1,excerpt:"After introducing Ethan to Pokémon a couple of months ago, this morning we finished rewatching the 82 episode strong first season. It’s…",frontmatter:{title:"Gotta Catch ‘Em All (again)",cover:"/images/pokemon-banner.jpg",date:"2018-05-29T21:49",tags:["entertainment","tv","pokemon","family","personal"],author:"eddie"},fields:{slug:"/gotta-catch-em-all-again"}},prev:{excerpt:"The latest episode of The Incomparable is fantastic;  episode 410 - I Am Not a Crackpot . It's a draft of the…",frontmatter:{title:"Simpsons Quotes",cover:"/images/the-simpsons-banner.jpg",date:"2018-06-10T08:01"},fields:{slug:"/simpsons-quotes"}},next:{excerpt:"Viva La Bam  will always be a fantastic show.",frontmatter:{title:"Viva La Bam",cover:"https://unsplash.it/1152/300/?random?Bam",date:"2018-05-21T22:23"},fields:{slug:"/viva-la-bam"}},authors:{edges:[{node:{id:"eddie",name:"Eddie Lee",image:"/images/eddielee.jpg",url:"https://twitter.com/eddielee6",bio:"Father and Software Engineer"}}]}},pathContext:{slug:"/gotta-catch-em-all-again",total:49,prev:"/simpsons-quotes",next:"/viva-la-bam"}}}});
